import { Email, Lock, Person } from '@mui/icons-material';
import React, { useState } from 'react';
import { signUpUser } from '../../redux/slice/autoSlice';
import './register.css'
import { Link } from 'react-router-dom';
import { useDispatch } from 'react-redux';
export default function Register() {
    const [prenom, setPrenom] = useState("");
    const [nom, setNom] = useState("");
    const [nomutilisateur, setNomutilisateur] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const dispatch = useDispatch();
    function registerHandle() {
        // console.table(prenom, nom, nomutilisateur, email, password)
        dispatch(signUpUser({prenom,nom,nomutilisateur,email,password}))
    }
    const sendEmail = (e) => {
        e.preventDefault();
    };

    return (
        <div className='RegisterTop'>
            <form action='' className='RegisterForm' onSubmit={sendEmail}>
                <h1 >Register</h1>
                <div className='RegisterInput'>
                    <input type='text' placeholder='Prénom' value={prenom} onChange={(e) => setPrenom(e.target.value)} />
                    <Person className='iconsRegister' />
                </div>
                <div className='RegisterInput'>
                    <input type='text' placeholder='Nom' value={nom} onChange={(e) => setNom(e.target.value)} />
                    <Person className='iconsRegister' />
                </div>
                <div className='RegisterInput'>
                    <input type='text' placeholder='Nom d’utilisateur' value={nomutilisateur} onChange={(e) => setNomutilisateur(e.target.value)} />
                    <Person className='iconsRegister' />
                </div>
                <div className='RegisterInput'>
                    <input type='email' placeholder='E_mail' value={email} onChange={(e) => setEmail(e.target.value)} />
                    <Email className='iconsRegister' />
                </div>
                <div className='RegisterInput'>
                    <input type='password' placeholder='Mot de passe' value={password} onChange={(e) => setPassword(e.target.value)} />
                    <Lock className='iconsRegister' />
                </div>
                <button type='submit' onClick={registerHandle}>Register</button>
                <div className='LoginLink'>
                    <p >Avez-vous un compte ? <Link to={'/login'}>Connectez-vous</Link></p>
                </div>
            </form>
        </div>
    );
}
